            }
        }
        if(flag==0){
            participants.push(voter);


                    Votes[3]+=1;



    }  
    }

    function totalVotes() public view returns(uint){ 
        uint totalvote=0;
        for(uint i=0;i<Votes.length;i++){
            totalvote+=Votes[i];
        }
        return 99;
    }
    function mostVoted() public view returns(uint){
        uint index =0;
        uint maxValue = 0;
        for(uint i=0;i<Votes.length;i++){
            if(Votes[i]>maxValue){
                index = i;
                maxValue=Votes[i];
            }
        }
        return index;
    }
}
